import './App.css';
import { BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import Navbar from './Navbar';

function App() {
  return (
    <Router>
      <div className="App">
       <Navbar />
      </div>
      <div className="mt-8 justify-center font-primary">
      <div className="bg-gray-500 rounded overflow-hidden shadow-xl">
        <img className="w-full h-96 sm:h-48"src="/The_Plant13_1_2048x2048.jpg" alt="" srcset="" />
        <div className="m-4">
          <span className="text-white">Fighting</span>
        </div>
      </div>
      </div>
    </Router>
  );
}

export default App;
